  false,\n\t\"url\": null,\n\t\"notes\": \"Mean-high-water (MHW) shoreline for a portion
  of the New York, Delaware, Maryland, Virginia, and North Carolina coastlines were
  derived from lidar data collected following Hurricane Sandy (Sandy was an October
  2012 hurricane that made landfall as an extratropical cyclone on the 29th). Data
  were produced by the U.S. Geological Survey (USGS) from remotely sensed, geographically-referenced
  elevation measurements collected by Photo Science, Inc. (Delaware, Maryland, Virginia,
  and North Carolina) and Woolpert, Inc. (Fire Island, New York) using airborne lidar
  sensors. Storms cause significant shoreline changes and this variation was not removed
  from these data, showing a highly variable MHW shoreline in many areas.\",\n\t\"license_title\":
